class MajorityChecker:
    def __init__(self, arr: List[int]):
        self.arr = arr
        self.nums: Dict[int:Set] = {}
        self.dp = {}
        for i in range(len(arr)):
            if self.nums.get(arr[i], None) is None:
                self.nums[arr[i]] = set()
            self.nums[arr[i]].add(i)

    def query(self, left: int, right: int, threshold: int) -> int:
        m = min(right - threshold + 2, (left + right) // 2 + 1)
        left_set = set(self.arr[left: m])
        right_set = set(self.arr[m - 1: right + 1])
        len_left = len(left_set)
        len_right = len(right_set)
        if len_left >= threshold + 1:
            return -1
        if len_left + len_right <= 10:  # 数据重复度高
            inter_set = left_set
        else:
            inter_set = left_set.intersection(right_set)
            if len_left-len(inter_set) < (right - left)//4:  # 数据很离散适合
                return -1
        idxs = set(range(left, right + 1))
        for num in inter_set:
            num_count = self.nums[num]
            if len(num_count) < threshold:
                continue
            count = len(num_count & idxs)
            if count >= threshold:
                # result = num
                # break
                return num
        else:
            return -1


